import React, { useState, useEffect } from "react";
import UserForm from "./components/UserForm";
import UserList from "./components/UserList";
import Navbar from "./components/Navbar";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ArticleMangement from "./components/ArticleMangement"; // Make sure you have this component
import ArticlesPage from "./components/ArticlesPage"; // Article listing component
import ArticleDetailsPage from "./components/ArticleDetailsPage"; // Individual article details page
import ArticleForm from "./components/ArticleForm"; // Create/Edit article form

const API_URL = "http://localhost:5000/api/users";
const API_URL_ARTICLES = "http://localhost:5000/api/articles"; // API for articles

function App() {
  const [users, setUsers] = useState([]);
  const [articles, setArticles] = useState([]);

  // Fetch users from backend
  useEffect(() => {
    fetch(API_URL)
      .then((response) => response.json())
      .then((data) => setUsers(data.users))
      .catch((error) => console.error("Error fetching users:", error));
  }, []);

  // Fetch articles from backend
  useEffect(() => {
    fetch(API_URL_ARTICLES)
      .then((response) => response.json())
      .then((data) => setArticles(data.articles))
      .catch((error) => console.error("Error fetching articles:", error));
  }, []);

  // Add a new user
  const addUser = (newUser) => {
    fetch(API_URL, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(newUser),
    })
      .then((response) => response.json())
      .then((data) => setUsers([...users, data.user]))
      .catch((error) => console.error("Error adding user:", error));
  };

  // Update an existing user
  const updateUser = (id, updatedUser) => {
    fetch(`${API_URL}/${id}`, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(updatedUser),
    })
      .then((response) => response.json())
      .then((data) => {
        setUsers(users.map((user) => (user._id === id ? data.user : user)));
      })
      .catch((error) => console.error("Error updating user:", error));
  };

  // Delete a user
  const deleteUser = (id) => {
    fetch(`${API_URL}/${id}`, {
      method: "DELETE",
    })
      .then(() => setUsers(users.filter((user) => user._id !== id)))
      .catch((error) => console.error("Error deleting user:", error));
  };

  // Add a new article
  const addArticle = (newArticle) => {
    fetch(API_URL_ARTICLES, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(newArticle),
    })
      .then((response) => response.json())
      .then((data) => setArticles([...articles, data.article]))
      .catch((error) => console.error("Error adding article:", error));
  };

  // Update an existing article
  const updateArticle = (id, updatedArticle) => {
    fetch(`${API_URL_ARTICLES}/${id}`, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(updatedArticle),
    })
      .then((response) => response.json())
      .then((data) => {
        setArticles(articles.map((article) => (article._id === id ? data.article : article)));
      })
      .catch((error) => console.error("Error updating article:", error));
  };

  // Delete an article
  const deleteArticle = (id) => {
    fetch(`${API_URL_ARTICLES}/${id}`, {
      method: "DELETE",
    })
      .then(() => setArticles(articles.filter((article) => article._id !== id)))
      .catch((error) => console.error("Error deleting article:", error));
  };

  return (
    <div>
      <Navbar />
      <div className="container">
        <h1>User Management</h1>
        <UserForm addUser={addUser} />
        <UserList users={users} updateUser={updateUser} deleteUser={deleteUser} />
      </div>

      <div className="container">
        <h1>Article Management</h1>
        <ArticleMangement addArticle={addArticle} /> {/* Adding new article */}
        <ArticlesPage articles={articles} deleteArticle={deleteArticle} /> {/* List of articles */}
      </div>

      <Routes>
        {/* Article routes */}
        <Route path="/articles" element={<ArticlesPage articles={articles} deleteArticle={deleteArticle} />} />
        <Route path="/articles/:id" element={<ArticleDetailsPage updateArticle={updateArticle} deleteArticle={deleteArticle} />} />
        <Route path="/articles/create" element={<ArticleForm addArticle={addArticle} />} />
        {/* User management route */}
        <Route path="/users" element={<UserForm addUser={addUser} />} />
        <Route path="/" element={<h1>Welcome to Blog System</h1>} />
      </Routes>
    </div>
  );
}

export default App;
